import React from "react"
import { BrowserRouter as Routers, Routes, Route,Link } from "react-router-dom";
import Home from "./Home";

function App() {
  return (
  
      <Routers>
     
        <Routes>
          <Route path="/" element={<Home />} />
          {/* <Route path="/cart" element={<AddCart />} /> */}
        </Routes>
        
      </Routers>
    

  )
}
export default App;
